content:
Nhiều vấn đề cho 1 sp rất phổ thông:
1. GH khá nhanh, nhanh hơn thông báo, điểm sáng duy nhất, trên bao bì ko ghi là 
     hàng gì;
2. Tuy nhiên: sp nhận được ko được như hình quảng cáo:
    2.1 Tôi đăng mua loại 60w, trên hàng gởi về ko có một chi tiết về nào về 60w  , do đó ko biết năng suất là bao nhiêu;
    2.2 Ko có giá đỡ khi sử dụ̣ng, ko thể chấp nhận được;
    2.3 Chỉ có 8 cây keo, thay vì 10 cây ;
Tôi xin gởi trả shop món hàng nầy. Xin hướng dẫn cách trả hàng, và mong shop trong tương lai lảm ăn đàng hoàn hơn.  Cho shop 3 sao, nhờ GH.
